import React from 'react';

const Footer = ({comments, shares, likes, emailLink}) => {
	return (
		<div>
			<div><img alt='' src={require('./like.svg')} className='mw1'/>{likes}</div>
			<div><img alt='' src={require('./comment.svg')} className='mw1'/>{comments}</div>
			<div><img alt='' src={require('./share.svg')} className='mw1'/>{shares}</div>
			<div><img alt='' src={require('./envelope.svg')} className='mw1'/></div>
		</div>
		)
}

export default Footer;
